  false,\n\t\"url\": null,\n\t\"notes\": \"The report covers fieldwork done in winters
  of 1986, 1987, 1988 to determine relative rodent densities  in agricultural habitats,
  determines the distribution and abundance of Northern Harriers, Red-tailed Hawks,
  American Kestrels, and Bald Eagles, to quantify the diet of Norther Harriers, and
  determine the feasibility of trapping and banding American Kestrels, Red-tailed
  Hawks, and Northern Harriers. Included is proposed field work at Holla Bend National
  Wildlife Refuge. The objective of the fieldwork are to determine the effects of
  habitat island size, vegetation structure, and predation pressure on rodent community
  structure, to determine the effects of rodent and passerine community structure
  to Norther Harrier foraging distribution and capture success in selected habitat
  islands and to determine broad geographic movement patterns of raptors overwintering
  at Holla Bend by banding as many individuals as possible.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
